function SponsorsContent(prop) {
    return (
<div
><div className="grid gap-0.5 sm:mx-0 overflow-hidden grid-cols-[repeat(2,minmax(0px,1fr))] md:grid-cols-[repeat(4,minmax(0px,1fr))]" style={{...{"borderRadius":"1rem"}}}
  ><a className="p-6 sm:p-10 relative text-[oklch(14.479%_0_none)] [background-color:oklch(100%_0_none)] [text-decoration:none_solid_oklch(14.479%_0_none)]"
    ><img {...{"width":"24","height":"6"}} className="h-8 block w-full ease-in-out align-middle duration-[0.15s] transition-colors" src=""
      /><span className="p-0 w-px h-px -m-px absolute overflow-hidden whitespace-nowrap [clip:rect(0px,0px,0px,0px)]" style={{...{"borderWidth":"0px"}}}
      >Loremi</span
      ></a
    ><a className="p-6 sm:p-10 relative text-[oklch(14.479%_0_none)] [background-color:oklch(100%_0_none)] [text-decoration:none_solid_oklch(14.479%_0_none)]"
    ><img {...{"width":"auto","height":"auto"}} className="h-auto max-h-12 block w-auto mx-auto" src="\1500x500-1547922000.jpg"
      /><span className="p-0 w-px h-px -m-px absolute overflow-hidden whitespace-nowrap [clip:rect(0px,0px,0px,0px)]" style={{...{"borderWidth":"0px"}}}
      >Lor</span
      ></a
    ><a className="p-6 sm:p-10 relative text-[oklch(14.479%_0_none)] [background-color:oklch(100%_0_none)] [text-decoration:none_solid_oklch(14.479%_0_none)]"
    ><img {...{"width":"auto","height":"auto"}} className="h-auto max-h-12 block w-auto mx-auto" src="\Polygonlogo.jpg"
      /><span className="p-0 w-px h-px -m-px absolute overflow-hidden whitespace-nowrap [clip:rect(0px,0px,0px,0px)]" style={{...{"borderWidth":"0px"}}}
      >Loremipsum</span
      ></a
    ><a className="p-6 sm:p-10 relative text-[oklch(14.479%_0_none)] [background-color:oklch(100%_0_none)] [text-decoration:none_solid_oklch(14.479%_0_none)]"
    ><img {...{"width":"24","height":"5"}} className="h-8 block w-full ease-in-out align-middle duration-[0.15s] transition-colors" src=""
      /><span className="p-0 w-px h-px -m-px absolute overflow-hidden whitespace-nowrap [clip:rect(0px,0px,0px,0px)]" style={{...{"borderWidth":"0px"}}}
      >Loremi</span
      ></a
    ></div
  ></div
>
);
}
export default SponsorsContent;
